import React from 'react';
import Project from './Project';
import Project_1 from './images/project1.jpg';

function ProjectCarousel() {
  const projects = [
    {
      title: 'Restaurant App',
      description: 'Lorem ipsum dolor sit amet, consectetur adipiscing elit. Vivamus euismod mollis risus a lobortis.',
      imageUrl: '',
      projectUrl: '#',
    },
    {
      title: 'Portfolio Website',
      description: 'Nullam eget mi elementum, bibendum ex quis, blandit nulla. Quisque eu libero varius, gravida orci non, ultricies ipsum.',
      imageUrl: 'https://via.placeholder.com/400x200',
      projectUrl: '#',
    },
    {
      title: 'Fetching API',
      description: 'Curabitur a magna vitae diam rutrum suscipit sed nec leo. Sed eget eros id mauris luctus pharetra.',
      imageUrl: 'https://via.placeholder.com/400x200',
      projectUrl: '#',
    },
  ];

  return (
    <section id="projects" style={{ marginLeft: "10px", display: "flex", alignItems: "center", flexDirection: "column", color: '#000000' }}>
      <h2>Projects</h2>
      <div style={{ marginLeft: "10px", color: '#000000', marginBottom: '25px' }}>
        <img src={Project_1} alt="Project 1" />
        <h3>Restaurant App</h3>
        <p>
          Lorem ipsum dolor sit amet, consectetur adipiscing elit. Vivamus euismod mollis risus a lobortis. 
        </p>
        <a href="#" target="_blank" rel="noopener noreferrer" style={{ color: '#ffffff', fontSize: '14px', textDecoration: 'none', padding: "8px", borderRadius: "5px", backgroundColor: "#27ae60", border: "none" }}>View Project</a>
      </div>

      <div style={{ marginLeft: "10px", color: '#000000', marginBottom: '25px' }}>
        <img src={Project_1} alt="Project 1" />
        <h3>Fetching API</h3>
        <p>
          Lorem ipsum dolor sit amet, consectetur adipiscing elit. Vivamus euismod mollis risus a lobortis. 
        </p>
        <a href="#" target="_blank" rel="noopener noreferrer" style={{ color: '#ffffff', fontSize: '14px', textDecoration: 'none', padding: "8px", borderRadius: "5px", backgroundColor: "#27ae60", border: "none" }}>View Project</a>
      </div>

      <div style={{ marginLeft: "10px", color: '#000000', marginBottom: '25px' }}>
        <img src={Project_1} alt="Project 1" />
        <h3>Portfolio Website</h3>
        <p>
          Lorem ipsum dolor sit amet, consectetur adipiscing elit. Vivamus euismod mollis risus a lobortis. 
        </p>
        <a href="#" target="_blank" rel="noopener noreferrer" style={{ color: '#ffffff', fontSize: '14px', textDecoration: 'none', padding: "8px", borderRadius: "5px", backgroundColor: "#27ae60", border: "none" }}>View Project</a>
      </div>
    </section>
  );
}

export default ProjectCarousel;
